import React from 'react';
import Common from './Common';
import { NavLink } from "react-router-dom";
import web from '../src/image/img2.jpg';
import web2 from '../src/image/welcome.gif'
// import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
// import '../node_modules/bootstrap/dist/js/bootstrap.min.js';

// <div className='container-fluid nav_bg'>
//     <div className='row'>
//         <div className='col-10 mx-auto'>

//         </div>
//     </div>
// </div>



const Home = () => {
    return (
        <>
            <Common hname=' G a t e 2022 Result Declared !!' bname='Click here' image={web} pname='more than 30+ students selected' /><br />
            {/* <p>Welcome</p> */}
            <Common hname='WELCOME to Association of Civil Engineering' bname='Know more about us!' image={web2} pname='Civil Engineering has served mankind since time immemorial. It has been at play since human civilization learnt to build homes, bridges and roads' />
            <div className='tab_section common_padding'>
                <h1 className='text-center'>Who we are</h1>
                <div className='container'>
                    <div className='row'>
                        <div col-md-12>
                            <div className='tabdata'>
                                <nav class="nav nav-tabs" role="tablist">
                                    <NavLink activeClassName="active_class" id="uncontrolled-tab-example-tab-Tab1" to="/aim" role="tab" data-rb-event-key="Tab1" aria-controls="uncontrolled-tab-example-tabpane-Tab1" aria-selected="true" class="nav-item nav-link ">
                                        <svg stroke="currentColor" fill="currentColor" stroke-width="0" t="1569683657482" viewBox="0 0 1024 1024" version="1.1" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"></svg><span class="ml-3">Aim</span>
                                    </NavLink>
                                    <NavLink activeClassName="active_class" id="uncontrolled-tab-example-tab-Tab2" to="/" role="tab" data-rb-event-key="Tab2" aria-controls="uncontrolled-tab-example-tabpane-Tab2" aria-selected="false" class="nav-item nav-link"><svg stroke="currentColor" fill="currentColor" stroke-width="0" role="img" viewBox="0 0 24 24" height="1em" width="1em" xmlns="http://www.w3.org/2000/svg"></svg><span class="ml-3">Vision</span></NavLink>
                                </nav>
                            </div>

                        </div>
                    </div>
                </div>
            </div>

        </>
    )
}

export default Home;
